http://download.vuimanga.vn/images/thumb/manga/200x200/BeachStars_1358321385.jpg',NULL,'Beach Stars là câu chuyện thuộc thể loại truyện tranh thể thao. Là câu chuyện về Nanase Iruka. Cô bé nhỏ con, tomboy và niềm vui duy nhất của cô là bóng chuyền. Vào sinh nhật lần thứ 17, câu lạc bộ bóng chuyền của cô giải tán. Cảm thấy buồn bã và thất vọng cô và bạn bè trong câu lạc bộ có một chuyến du lịch đến bãi biển và phát hiện ra bóng chuyền bãi biển. Iruka rất vui mừng và đi đăng ký tham gia, nhưng cô quá lùn để được tham gia vào câu lạc bộ bóng chuyền bãi biển. Vào lúc đó, Iruka đã cố gắng chứng tỏ thực lực của bản thân. Có vẻ như không có cơ hội cho cô, nhưng Iruka có một vũ khí bí mật và không ai có thể lấ','truyen Beach Stars, truyen tranh Beach Stars, doc truyen Beach Stars, Beach Stars, manga Beach Stars','Truyện tranh Beach Stars: đọc các chapter truyện tiếng Việt Beach Stars hay nhất, vừa cập nhật mới nhất  (trang 1)',7,1,1,0,'2013-10-08 23:44:28','2013-10-12 01:38:42','2013-10-08 23:44:28',1),(139,'http://vuitruyentranh.vn/truyen-tranh/bushidou-sixteen/173/',1,'173','Bushidou Sixteen','Truyện tranh Bushidou Sixteen','bushidou-sixteen','/upload/imagesbushidou-sixteen_139.jpg','http://download.vuimanga.vn/images/thumb/manga/200x200/image_1365997485.jpg',NULL,' Bushidou Sixteen là bộ truyện tranh thể thao của tác giả  Honda Tetsuya, ANDO Jiro. Kaori được học kendo từ bé và là một kiếm sĩ đầy nhiệt huyết. Sanae tuy không luyện kendo thường xuyên nhưng lại đánh bại Kaori trong giải Kendo các trường trung học. Mặc dầu Sanae không chú trọng chuyện đó lắm, Kaori sinh lòng căm hận và quyết tâm tìm Sanae trả đòn. Chuyện gì sẽ xảy ra tiếp theo. Hãy cùng vuitruyentranh thưởng thức bộ truyện hấp dẫn này nhé!','truyen Bushidou Sixteen, truyen tranh Bushidou Sixteen, doc truyen Bushidou Sixteen, Bushidou Sixteen, manga Bushidou Sixteen','Truyện tranh Bushidou Sixteen: đọc các chapter truyện tiếng Việt Bushidou Sixteen hay nhất, vừa cập nhật mới nhất  (trang 1)',7,1,1,0,'2013-10-08 23:44:28','2013-10-12 01:39:10','2013-10-08 23:44:28',1),(140,'http://vuitruyentranh.vn/truyen-tranh/bowling-king/202/',1,'202','Bowling King','Truyện tranh Bowling King','bowling-king','/upload/imagesbowling-king_140.jpg','http://download.vuimanga.vn/images/thumb/manga/200x200/BowlingKing_1358322468.jpg',NULL,'Bowling King là một bộ truyện thuộc thể loại truyện tranh thể thao. Bộ truyện tranh nói về một cậu bé đầy cá tính, chỉ vì ra tay nghĩa hiệp cứu “mỹ nhân” đã vô tình bước vào con đường của một đấu thủ Bowling chuyên nghiệp. Liệu với năng khiếu bẩm sinh cộng với ý chí sắt đá, cậu có đi hết con đường mình đã chọn trở thành một “Bowling King” chính hiệu hay không? Một câu chuyện cực kỳ hài hước va không kém phần hấp dẫn với những trận đấu Bowling đỉnh cao. Hãy đón xem Bowling King tại vuitruyentranh.vn nhé!','truyen Bowling King, truyen tranh Bowling King, doc truyen Bowling King, Bowling King, manga Bowling King','Truyện tranh Bowling King: đọc các chapter truyện tiếng Việt Bowling King hay nhất, vừa cập nhật mới nhất  (trang 1)',7,1,1,0,'2013-10-08 23:44:28','2013-10-12 01:39:23','2013-10-08 23:44:28',1),(141,'http://vuitruyentranh.vn/truyen-tranh/cross-manage/408/',1,'408','Cross Manage','Truyện tranh Cross Manage','cross-manage','/upload/imagescross-manage_141.jpg','http://download.vuimanga.vn/images/thumb/manga/200x200/image_1365583363.jpg',NULL,'Cross Manage là bộ truyện tranh Thể thao trên trang truyện tranh tiếng Việt vuitruyentranh. Nhân vật chính của bộ truyện này là cậu học sinh trung học Sakurai, trong từ điển của Sakurai không hề có từ \"Nỗ lực\" và \"Sợ thất bại\". Nhưng rồi một ngày, do vô tình vào nhầm phòng mà cậu nhìn thấy cô bạn cùng lớp Toyoguchi đang thay đồ. Và rồi đời cậu đã thay đổi từ đây! Đổi lại việc Toyoguchi giữ bí mật về vụ đó Sakurai phải làm quản lý cho câu lạc bộ Lacrosse mà Toyoguchi lập ra. Ban đầu cậu chỉ làm vì tình thế ép buộc nhưng dần dần cậu lại bắt đầu yêu thích công việc này. Mời bạn đến với kho truyện tranh vuitruyentranh để cùng theo dõi câu chuyện giữa Saku','truyen Cross Manage, truyen tranh Cross Manage, doc truyen Cross Manage, Cross Manage, manga Cross Manage','Truyện tranh Cross Manage: đọc các chapter truyện tiếng Việt Cross Manage hay nhất, vừa cập nhật mới nhất  (trang 1)',7,1,1,0,'2013-10-08 23:44:28','2013-10-12 01:40:03','2013-10-08 23:44:28',1),(142,'http://vuitruyentranh.vn/truyen-tranh/cross-over/419/',1,'419','Cross Over','Truyện tranh Cross Over','cross-over','/upload/imagescross-over_142.jpg','http://download.vuimanga.vn/images/thumb/manga/200x200/image_419.jpg',NULL,'Cross Over là một trong những bộ manga thuộc thể loại truyện tranh Thể thao trên trang vuitruyentranh. Câu chuyện xoay quanh Ogata Natsuki, một cầu thủ bóng rổ đầy tài năng tuy có chiều cao khiêm tốn, do học 3 năm cấp hai tại một ngôi trường vô danh nên cậu chưa từng đạt một danh hiệu nào. Lên cấp 3, Natsuki quyết định thi vào trường Fujiwara với huyền thoại 134 trận toàn thắng, nhưng vì một nguyên nhân nào đó, và vì một \"ai\" đó cậu đã tuyên bố \"Chính tôi sẽ chấm dứt cái kỷ lục vớ vẩn này\". Liệu Natsuki có thành công không? Mời bạn lên kho truyện tranh vuitruyentranh để cùng theo dõi bộ truyện Cross Over nhé!','truyen Cross Over, truyen tranh Cross Over, doc truyen Cross Over, Cross Over, manga Cross Over','Truyện tranh Cross Over: đọc các chapter truyện tiếng Việt Cross Over hay nhất, vừa cập nhật mới nhất  (trang 1)',7,1,1,0,'2013-10-08 23:44:28','2013-10-12 01:40:12','2013-10-08 23:44:28',1),(143,'http://vuitruyentranh.vn/truyen-tranh/crimson-hero/434/',1,'434','Crimson Hero','Truyện tranh Crimson Hero','crimson-hero','/upload/imagescrimson-hero_143.jpg','http://download.vuimanga.vn/images/thumb/manga/200x200/image_1365135203.jpg',NULL,'Crimson Hero là bộ manga thuộc thể loại truyện tranh Thể thao trên trang vuitruyentranh. Nội dung câu chuyện xoay quanh tâm tư và tình cảm của cô bạn Nobara Sumiyoshi 15 tuổi với niềm đam mê bóng chuyền mãnh liệt. Nhưng ước mơ ấy hiện gặp khá nhiều khó khăn khi mẹ Nobara thì kịch liệt phản đối, đội bóng chuyền nữ ở trường thì bị giải tán từ lâu và giờ Nobara còn phải ở chung nhà trọ với một lũ con trai. Tuổi trẻ thường mang khuynh hướng nổi loạn, riêng với cô bạn Nobara thì sự nổi loạn ấy gấp đôi bình thường. Và với tính cách mạnh mẽ của mình thì dù là khó khăn gì đi chăng nữa Nobara cũng không bao giờ từ bỏ tình yêu bóng chuyền của mình.','truyen Crimson Hero, truyen tranh Crimson Hero, doc truyen Crimson Hero, Crimson Hero, manga Crimson Hero','Truyện tranh Crimson Hero: đọc các chapter truyện tiếng Việt Crimson Hero hay nhất, vừa cập nhật mới nhất  (trang 1)',7,1,1,0,'2013-10-08 23:44:28','2013-10-12 01:41:07','2013-10-08 23:44:28',1),(144,'http://vuitruyentranh.vn/truyen-tranh/cross-game/446/',1,'446','Cross game','Truyện tranh Cross game','cross-game','/upload/imagescross-game_144.jpg','http://download.vuimanga.vn/images/thumb/manga/200x200/Crossgame_1358324303.jpg',NULL,'Tác phẩm mới nhất của Adachi-sensei về bóng chày. Truyện gồm 2 phần. Phần 1 có nhân vật chính là cậu bé Koh Kitamura, 8 tuổi, con của một gia đình buôn bán các dụng cụ thể thao và cô bạn gái Wakaba Tsukihima sinh cùng ngày, rất thân thiết với Koh. Phần 1 kết thúc khi Wakaba bị tai nạn qua đời. Phần 2 là truyện về Koh 4 năm sau, khi Koh bắt đầu một cuộc sống mới mà không có Wakaba. Lên cấp 3, Koh tham gia vào đội bóng chày trường Seishu. Cậu gặp những người bạn mới, những đối thủ mới,và cả tình yêu mới với Aoba, em gái của Wakaba, rất yêu chị và ghét Koh nhưng có tính cánh rất giống Koh. Koh vẫn luôn luôn nhớ về Wakaba và quyết tâm làm một pitcher ném quả bóng nhanh 160 km/h trên sân Koushen như ước mơ của Wakaba khi còn sống. Mời các b','truyen Cross game, truyen tranh Cross game, doc truyen Cross game, Cross game, manga Cross game','Truyện tranh Cross game: đọc các chapter truyện tiếng Việt Cross game hay nhất, vừa cập nhật mới nhất  (trang 1)',7,1,1,0,'2013-10-08 23:44:28','2013-10-12 01:41:25','2013-10-08 23:44:28',1),(145,'http://vuitruyent